/*
 * jQuery dynamicTimezones Plugin v1.0
 * http://github.com/jrhizor/jquery.dynamicTimezones
 */
(function($){$.fn.dynamicTimezones=function(datestring){return this.each(function(){timestamp=getTimestamp(this.getAttribute('class'));this.innerHTML=date(datestring,timestamp);});};getTimestamp=function(el){return parseInt((el.split(' '))[1]);}})(jQuery);